import { Dialog,Box } from "@mui/material";

const dialogstyle={

    height:'96%',
    marginTop:'12%',
    width:'60%',
    maxWidth:'100%',
    maxHeight:'100%',
    boxShadow:'none',
    overflow:'none'

}

const LoginDialog = () => {

    return (
        <Dialog 
        open={true}
        P
        >
            <Box>
                <Box>
                    <p></p>

                </Box>
            </Box>
        </Dialog>
    )
}

export default LoginDialog;
